import React, { useState } from 'react'
import ProductCard from '../components/ProductCard'

const ProductGrid = ({title}) => {

  const [products, setProducts] = useState([
    { id: 1, productName: "Modern Black Blouse", category: "Tops", price: "$35.00", ratng: 5, img: "bg.png"},
    { id: 2, productName: "Blue Jeans", category: "Denim", price: "$40.00", ratng: 3, img: "bg.png"},
    { id: 3, productName: "Black Jacket", category: "Outerwear", price: "$55.00", ratng: 5, img: "bg.png"},
    { id: 4, productName: "white sneakers", category: "Shoes", price: "$50.00", ratng: 4, img: "bg.png"}
  ])
  return (
    <section className="grid-products">
      <h2>{title}</h2>
      <div className="container">
        <div className="row row-cols-1 row-cols-md-4 g-3"> 
        {
          products.map(product => <ProductCard item={product}/>)
        }
        </div>
      </div>
    </section>
  )
}

export default ProductGrid
